import './App.css';
import { useState } from 'react';
import Card from './components/Card'

function App() {
  const [state, setState] = useState([]);

  const fetchTeams = () => {
    fetch('/competitions/')
      .then(res => res.json())
      .then(data => setState(data))
  }

  return (
    <section>
      <button onClick={fetchTeams}>GO</button>
      <Card 
        state={state}
      />
    </section>
  );
}

export default App;
